import "./contact.css";
import Header from "../header";
import Footer from "../footer";

function Contact() {
  return (
    <div>
    <Header />
    <div className="row justify-content-center">
        <div className="col-sm-12 col-md-12 col-lg-12">
            <h1>CONTACT PAGE</h1>
        </div>
    </div>
    <Footer />
    </div>
  );
}

export default Contact;
